	function shapeApplyStyle(raphaelShapeObject, customFill) {
		//Apply style to a shape path. Apply default style if none specified.
		
		var strokeWidth = 0;		
		var fill = "#004889";
		
		if (customFill) {
			fill = customFill;
		}
		
		console.log(fill);
		
		raphaelShapeObject.attr({fill : fill, "stroke-width" : strokeWidth});
	}
	
	
